import React from 'react';
import PostCard from './PostCard';


export default function PostGrid({posts}){

    return(
        <div>
            <h1>BLOG TITLE</h1>    
            {posts && posts.map(post=><PostCard key={post.id}>{post}</PostCard>)}

        </div>
    )
}
